import {Button, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, TextField} from '@mui/material';
import React, {useState} from 'react';
import {useNavigate} from 'react-router-dom';
// import {patientData} from "../components/Data"

const patientData = [
    {
        id: 1,
        name: "Jane Doe",
        gender: "Female",
        dob: "02/02/1985",
        image: "https://images.unsplash.com/photo-1486739985386-d4fae04ca6f7?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxjb2xsZWN0aW9uLXBhZ2V8MXw5OTE1NzA1fHxlbnwwfHx8fA%3D%3D&auto=format&fit=crop&w=500&q=60"
    },
    
    {
        id: 5,
        name: "Jane Doe",
        gender: "Female",
        dob: "02/02/1985",
        image: "https://images.unsplash.com/photo-1486739985386-d4fae04ca6f7?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxjb2xsZWN0aW9uLXBhZ2V8MXw5OTE1NzA1fHxlbnwwfHx8fA%3D%3D&auto=format&fit=crop&w=500&q=60"
    },
    {
        id: 6,
        name: "Bob Smith",
        gender: "Male",
        dob: "03/03/1990",
        image: "https://randomuser.me/api/portraits/men/3.jpg"
    }, 
];


function Header() {
    const navigate = useNavigate();
    const [newPatientData, setNewPatientData] = useState({name: "", dob: "", gender: "", image: ""});
    const [data, setData] = useState([])
    const [open, setOpen] = useState(false)


    const handleClick = () => {
        navigate('/patients');
    };

    const handleAddPatient = () => {
        // Create a new patient object
        const newPatient = {...newPatientData, patientData};

        // Add the new patient to the data array
        const newData = [...data, newPatient];
        setData(newData);

        // Close the popup
        setOpen(false);
        // Reset the new patient data state
        setNewPatientData({name: "", dob: "", gender: "", image: ""});
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div>
            <header className="header">
                <div className="brand-box">
                    <span className="brand">Shree Krishna Hospital</span>
                </div>

                <div className="text-box">
                    <h1 className="heading-primary">
                        <span className="heading-primary-main">All Entries and List of Patient</span>
                    </h1>
                    <Button
                        style={{width: "300px", height: "60px", backgroundColor: "black", color: "white", borderColor: " white", fontSize: "20px", borderRadius: "15px"}}
                        variant="outlined"
                        onClick={() => setOpen(true)}
                    >
                        Add Patient
                    </Button>

                    <Button
                        style={{width: "300px", height: "60px", backgroundColor: "black", color: "white", borderColor: " white", fontSize: "20px", borderRadius: "15px", marginLeft: "20px"}}
                        variant="outlined"
                        onClick={handleClick}
                    >
                        See Patients List
                    </Button>
                </div>
                <Dialog open={open} onClose={handleClose}>
                    <DialogTitle>Add New Patient</DialogTitle>
                    <DialogContent>
                        <DialogContentText>
                            Enter the details of the new patient below:
                        </DialogContentText>
                        <TextField
                            autoFocus
                            margin="dense"
                            label="Name"
                            fullWidth
                            value={newPatientData.name}
                            onChange={(e) => setNewPatientData({...newPatientData, name: e.target.value})}
                        />
                        <TextField
                            margin="dense"
                            label="Date of Birth"
                            fullWidth
                            value={newPatientData.dob}
                            onChange={(e) => setNewPatientData({...newPatientData, dob: e.target.value})}
                        />
                        <TextField
                            margin="dense"
                            label="Gender"
                            fullWidth
                            value={newPatientData.gender}
                            onChange={(e) => setNewPatientData({...newPatientData, gender: e.target.value})}
                        />
                        <div>
                            <input
                                type="file"
                                accept="image/*"
                                onChange={(e) => setNewPatientData({...newPatientData, image: e.target.files[0]})}
                            />
                        </div>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={handleClose} color="primary">
                            Cancel
                        </Button>
                        <Button onClick={handleAddPatient} color="primary">
                            Add
                        </Button>
                    </DialogActions>
                </Dialog>

            </header>
        </div>
    );
}

export default Header;
